My fellow croucher in this photo is my friend Kenneth Rocafort! From comic book fame, no less! And that handome fellow behind us is one of 40 gorillas on Durrell's new Go Wild Gorilla Trail! This one was painted by the mighty Kenneth himself. However, many other artists also graced us with their talents to paint the Gorillas that populate the Gorilla Trail which will guide visitors, and locals alike, around the island on a path of conservation enlightenment. Go Wild Gorillas' primary task is to raise funds so that they can build our family of Western Lowland Gorillas a new and even more fantastic home at Jersey Zoo.

Find out more by following the link in my bio.

Animal fact incoming: The Western Lowland Gorilla is one of a group of animals that has a triplet of a name in Latin. Which is divided into Genus, Species and Subspecies it is quite simply Gorilla Gorilla Gorilla. 
Boom. Knowledge. Go forth.
