The journey continues. Thank you to Mr Dave Rienzi for being such a wonderful guide.
My physical journey over the years has been an interesting one, with plenty of pit falls and plenty of moments of reward. I've been reflecting on them a lot recently and I've been very fortunate to work with some fantastic minds. I'm thankful to them all. Recently I've been exploring some of the big players in bodybuilding, both from the past and the present. It's absolutely fascinating to see what they put themselves through, the drive and mental strength required to get to such a place physically. Phil Heath in particular has caught my eye not only for his achievements but also for his genuinely humble and informative approach to his messaging. All this while being a 7x Mr Olympia. If you haven't checked out his page it's worth a peek. 
@DaveRienzi
@PhilHeath
#GymStuff

