So, there is this little movie coming out in November called Justice League. It may have come up on your radar once or twice. It involves a group of superheroes doing super heroic stuff. Facial hair is involved. 
Anyways, I'm here to let you know that you lovely people (who will undoubtedly have watched said movie at least 6 or 7 times by this point) will have an opportunity to come meet me, Jason Momoa, Gal Gadot, Ezra Miller, Ray Fisher and Ciaran Hinds in December at ACE Comic Con in Long Island, NY!!
Whaaaaat? I hear you say. Yes dear friends, get all your moustache related questions ready because I will be there to answer them. I can't wait to meet you all and to also wax lyrical about DC on the big screen. 
